var PicoHelper=function(){};PicoHelper.invalid=function(a,c){var b=document.getElementById(a);b&&(b.ariaInvalid=c)};PicoHelper.busy=function(a,c){var b=document.getElementById(a);b&&(b.ariaBusy=c)};PicoHelper.showModal=function(a){(a=document.getElementById(a))&&a.setAttribute("open","")};PicoHelper.hideModal=function(a){(a=document.getElementById(a))&&a.removeAttribute("open")};
